import Backdrop from "./components/Backdrop";
import Modal from "./components/Modal";
import Todo from "./components/Todo";


function App() {
  return (
  <div >
    <h1>My Page</h1>
    <Todo text="Learn"/>
    <Todo text="React"/> 
    <Todo text="master"/>
    <Modal></Modal>
    <Backdrop></Backdrop>
  </div>
  );
}

export default App;
